import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navigation.css'

import logo from '../../../assets/images/logo.svg'
import discover from '../../../assets/images/discover.svg';
import library from '../../../assets/images/library.svg';
import profile from '../../../assets/images/profile.svg'

import Input from '../Input/Input';


const Navigation = () => (
  <div className="navigation">
    <div className="navigation_item">
      <NavLink activeClassName="active" exact to='/'><svg width="16" height="15" viewBox="0 0 16 15" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path fill-rule="evenodd" clip-rule="evenodd" d="M15.4012 7.31855C15.684 7.00965 15.6567 6.53621 15.3403 6.26135L8.36994 0.202419C8.05356 -0.0724364 7.54632 -0.0666786 7.2366 0.215399L0.242572 6.58439C-0.0671508 6.86647 -0.0823522 7.33931 0.208915 7.64007L0.384265 7.82149C0.675177 8.12226 1.1454 8.15812 1.43387 7.90134L1.95657 7.43633V14.2442C1.95657 14.6619 2.29725 15 2.7174 15H5.44369C5.86384 15 6.20453 14.6619 6.20453 14.2442V9.48143H9.68194V14.2442C9.67589 14.6616 9.97651 14.9997 10.3967 14.9997H13.2858C13.706 14.9997 14.0467 14.6616 14.0467 14.2439V7.53219C14.0467 7.53219 14.1911 7.65785 14.3692 7.81336C14.547 7.96857 14.9204 7.84412 15.2031 7.53492L15.4012 7.31855Z" fill="#1A1B1C" />
      </svg>
        <span>Discover</span></NavLink>
      <NavLink activeClassName="active" to='/library'><img src={library} alt="library" /><span>library</span></NavLink>
    </div>
    <div className="navigation">
      <NavLink activeClassName="active" exact to='/'><img src={logo} alt="" /></NavLink>
    </div>
    <div className="navigation_item rignt_nav">
      <Input elementType="search" />
      <img src={profile} alt="profile" />
      <span>Sign Up</span>
    </div>
  </div>
);

export default Navigation;
